import React from 'react';

import './styles.scss';

const Header = () => {
  return (
    <div id="wrapper-main">
      <div className="header">
        <h1 className="page__title">Buy Electronics</h1>
        <h1 className="mobile__logo__replacement">Mian Electronics</h1>
      </div>
    </div>
  );
};

export default Header;
